import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './HomePage';
import RealTimeTracking from './pages/RealTimeTracking';
import AnalyticsReports from './pages/AnalyticsReports'; // Import AnalyticsReports

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/real-time-tracking" element={<RealTimeTracking />} />
        <Route path="/analytics-reports" element={<AnalyticsReports />} /> {/* Add route for AnalyticsReports */}
      </Routes>
    </Router>
  );
}

export default App;
